var acsilstoreApp = angular.module('acsilstoreApp', [
  'ngRoute',
  'ngMaterial',
  'ngCookies',
  'homeControllers',
  'moduleControllers',
  'userControllers',
  'acsilModule',
  'acsilUser',
  'acsilToken'
]);

acsilstoreApp.config(['$routeProvider', '$compileProvider', '$httpProvider',
    function ($routeProvider, $compileProvider, $httpProvider) {
        $routeProvider.
          when('/', {
              templateUrl: 'partials/home.html',
              controller: 'HomeCtrl'
          }).
          when('/user/subscribe', {
              templateUrl: 'partials/subscribe.html',
              controller: 'SubscribeCtrl'
          }).
          when('/user/:id', {
              templateUrl: 'partials/user.html',
              controller: 'UserCtrl'
          }).
          when('/module', {
              templateUrl: 'partials/moduleList.html',
              controller: 'ModuleListCtrl'
          }).
          when('/module/:id', {
              templateUrl: 'partials/moduleDetail.html',
              controller: 'ModuleViewCtrl'
          }).
      otherwise({
          redirectTo: '/'
      });

        $compileProvider.aHrefSanitizationWhitelist(/^\s*(https?|ftp|mailto|chrome-extension|data):/);

        // register the interceptor via an anonymous factory
        $httpProvider.interceptors.push(function ($q, $rootScope) {
            return {
                'request': function (config) {
                    var token = $rootScope.token;
                    if (token != null) {
                        config.headers['Authorization'] = token;
                    }
                    return config;
                },

                'response': function (response) {
                    // same as above
                    return response;
                }
            };
        });
    }]);

